import React from 'react';
import './index.css';
import Icon1 from './icons/mail.png';

const dockIcon = [{ id: 1, name: 'mail', img: './icons/mail.png' }];

function Dock() {
  return (
    <div className="dock-container">
      {dockIcon.map((icon) => (
        <div className="icon-container">

            {icon.name}</div>
      ))}
    </div>
  );
}

export default Dock;
